<body class="c29" style="margin: auto;"><p class="c21"><span class="c7">PRIVACY POLICY</span></p>
<p class="c20"><span class="c30 c22 c33"></span></p>
<p class="c26"><span class="c13">This Privacy Policy (this "</span><span class="c30">Policy</span><span class="c13">") applies to collection, use and disclosure of Personal Data (hereinafter defined) by </span><span
        class="c13">Chateraise Co., Ltd.,</span><span class="c13">&nbsp;and its subsidiaries, affiliates, associated companies and franchisees (collectively referred to as </span><span
        class="c30">we</span><span class="c13">, </span><span class="c30">us</span><span
        class="c13">, or </span><span class="c30">our</span><span class="c2">). Please read this Policy carefully to understand our views and practices regarding your Personal Data and click the button to show your consent to this Policy to agree to our processing of your Personal Data. If you do not agree to this Policy, please do not access or use our application. </span>
</p>
<p class="c17" id="h.gjdgxs"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-0 start" start="1">
    <li class="c14 li-bullet-0"><h1 style="display:inline"><span class="c18">GENERAL </span></h1></li>
</ol>
<ol class="c4 lst-kix_list_36-1 start" start="1">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span
                class="c13">For the purposes of this Policy, </span><span class="c30">Personal Data</span><span
                class="c2"> shall mean data, whether true or not, about an individual who can be identified: (a) from that data; or (b) from that data and other information to which we have or are likely to have access, including but not limited to name, identification number, birth date, address, postal code and contact information. Such Personal Data shall also refer to that which is already in our possession or that which shall be collected by us in the future.</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="2">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c13">We shall use reasonable endeavours to ensure all collection and/or storage and/or disclosure and/or usage of Personal Data by us shall be done in an appropriate manner and in accordance with the Act on the Protection of Personal Information of Japan (Act No. 57 of May 30, 2003) and the Personal Data Protection Act 2012 of the Republic of Singapore (No. 26 of 2012) (collectively, the </span><span
                class="c30">Act</span><span class="c2">), and this Policy. </span></h2></li>
</ol>
<p class="c17"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="3">
    <li class="c6 li-bullet-0"><h2 style="display:inline"><span class="c2">Our officers, management, and members of staff shall use reasonable endeavours to respect the confidentiality of and keep safe any and all Personal Data collected and/or stored and/or disclosed and/or used for, or on behalf of, us. </span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-0" start="2">
    <li class="c14 li-bullet-0"><h1 style="display:inline"><span class="c18">COLLECTION, USE AND DISCLOSURE OF PERSONAL DATA</span>
        </h1></li>
</ol>
<ol class="c4 lst-kix_list_36-1 start" start="1">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c13">We generally do not collect your Personal Data unless (a) it is provided to us voluntarily by you directly or via a third party who has been duly authorised by you to disclose your Personal Data to us (your </span><span
                class="c30">authorised representative</span><span class="c2">) after (i) you (or your authorised representative) have been notified of the purposes for which the Personal Data is collected, and (ii) you (or your authorised representative) have provided consent to the collection and usage of your Personal Data for those purposes, or (b) collection and use of Personal Data without consent is permitted or required by the Act or other laws. We shall seek your consent before collecting any additional Personal Data and before using your Personal Data for a purpose which has not been notified to you (except where permitted or authorised by law). </span>
        </h2></li>
</ol>
<p class="c17"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="2">
    <li class="c14 li-bullet-0"><h2 id="h.30j0zll" style="display:inline"><span class="c2">We may collect and use your Personal Data for any or all of the following purposes:</span>
        </h2></li>
</ol>
<ol class="c4 lst-kix_list_36-2 start" start="1">
    <li class="c3 li-bullet-0"><h3 id="h.1fob9te" style="display:inline"><span class="c2">sending marketing information about our goods or services including notifying you of our marketing events, initiatives and promotions, membership and rewards schemes, vouchers and other promotions or campaigns; </span>
        </h3></li>
    <li class="c3 li-bullet-0"><h3 style="display:inline"><span class="c2">processing and administering your membership registration and mail-magazine registration;</span>
        </h3></li>
    <li class="c3 li-bullet-0"><h3 style="display:inline"><span class="c2">performing our obligations in the course of or in connection with our provision of any goods and/or services requested by you, including but not limited to delivery of products purchased or giveaway merchandise and usage or redemption of our vouchers, coupons and/or rewards;</span>
        </h3></li>
    <li class="c15 c24 li-bullet-0"><h3 style="display:inline"><span class="c2">processing payment or credit transactions, if applicable;</span>
        </h3></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-2" start="5">
    <li class="c3 li-bullet-0"><h3 style="display:inline"><span class="c2">responding to, handling and processing queries, requests, applications, complaints and feedback from you;</span>
        </h3></li>
    <li class="c23 li-bullet-0"><h3 style="display:inline"><span class="c2">carrying out customer surveys, analysis and market research;</span>
        </h3></li>
    <li class="c3 li-bullet-0"><h3 style="display:inline"><span class="c2">complying with any applicable laws, regulations, codes of practice, guidelines or rules, or to assist in law enforcement and investigations conducted by any governmental and/or regulatory authority;</span>
        </h3></li>
    <li class="c23 li-bullet-0"><h3 style="display:inline"><span class="c2">any other purposes for which you have provided the information;</span>
        </h3></li>
    <li class="c3 li-bullet-0"><h3 style="display:inline"><span class="c2">transmitting to any third parties including our affiliates, franchisees, data intermediaries, third party service provides and agents, and relevant governmental and/or regulatory authorities, whether in Singapore or abroad, for the aforementioned purposes; and/or</span>
        </h3></li>
    <li class="c15 c24 li-bullet-0"><h3 style="display:inline"><span class="c2">any other incidental business purposes related to or in connection with the above.</span>
        </h3></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="3">
    <li class="c14 li-bullet-0"><h2 id="h.3znysh7" style="display:inline"><span class="c2">We may disclose your Personal Data:</span>
        </h2></li>
</ol>
<ol class="c4 lst-kix_list_36-2 start" start="1">
    <li class="c3 li-bullet-0"><h3 style="display:inline"><span class="c2">where such disclosure is necessary for performing obligations in the course of or in connection with our provisions of the goods or services requested by you;</span>
        </h3></li>
    <li class="c3 li-bullet-0"><h3 style="display:inline"><span class="c2">where such disclosure is required by any applicable laws, regulations, codes of practice, guidelines or rules, or to assist in law enforcement and investigations conducted by any governmental and/or regulatory authority;</span>
        </h3></li>
    <li class="c24 c32 li-bullet-0"><h3 style="display:inline"><span class="c2">to any third parties including our affiliates, franchisees, data intermediaries, third party service provides and agents, and relevant governmental and/or regulatory authorities, whether in Singapore or abroad, for the purposes listed in clause 2.2 above;</span>
        </h3></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="4">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">The purposes listed in the clauses 2.2 and 2.3 above may continue to apply even in situations where your relationship with us (for example, pursuant to a contract) has been terminated or altered in any way, for a reasonable period thereafter (including, where applicable, a period to enable us to enforce our rights under any contract with you).</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="5">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">You warrant and represent that Personal Data which you disclose to us shall be accurate and complete. If you provide us with Personal Data relating to a third party, you warrant and represent to us that you have obtained the consent of the third party and are authorised by the third party to do so.</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="6">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">The decision to provide us with your Personal Data is solely yours to make, but you acknowledge that if you choose not to submit your Personal Data to us or subsequently withdraw your consent to our use of your Personal Data, we may not be able to provide you with our goods or services. </span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="7">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">We may use cookies on our websites or applications to track website or application visitorship and experience. Most web browsers are designed to accept cookies. If you do not wish to receive any cookies, you may set your browser to refuse it.</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="8">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">Please be informed that when you use any application provided by us, such application may acquire information such as your location, device identification details, as well as mobile device information. If you do not wish to provide us with such information, you may activate the function to disable location on your mobile device. </span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-0" start="3">
    <li class="c14 li-bullet-0"><h1 style="display:inline"><span class="c18">WITHDRAWING YOUR CONSENT</span></h1>
    </li>
</ol>
<ol class="c4 lst-kix_list_36-1 start" start="1">
    <li class="c1 li-bullet-0"><h2 id="h.2et92p0" style="display:inline"><span class="c2">The consent that you provide for the collection, use and disclosure of your Personal Data will remain valid until such time it is being withdrawn by you in writing. You may withdraw consent and request us to stop using and/or disclosing your Personal Data for any or all of the purposes listed in clauses 2.2 and 2.3 above by submitting your request in writing or via email to our Data Protection Officer at the contact details provided below.</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="2">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">Upon receipt of your request to withdraw your consent, we may require reasonable time (depending on the complexity of the request and its impact on our relationship with you) for your request to be processed and for us to notify you of the consequences of us acceding to the same, including any legal consequences which may affect your rights and liabilities to us. In general, we shall seek to process your request within ten (10) business days of receiving it.</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="3">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">Whilst we respect your decision to withdraw your consent, please note that depending on the nature and scope of your request, we may not be in a position to continue providing our goods or services to you and we shall, in such circumstances, notify you before completing the processing of your request. Should you decide to cancel your withdrawal of consent, please inform us in writing in the manner described in clause 3.1 above.</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="4">
    <li class="c6 li-bullet-0"><h2 style="display:inline"><span class="c2">Please note that withdrawing consent does not affect our right to continue to collect, use and disclose Personal Data where such collection, use and disclose without consent is permitted or required under applicable laws.</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-0" start="4">
    <li class="c14 li-bullet-0"><h1 style="display:inline"><span class="c18">ACCESS TO AND CORRECTION OF PERSONAL DATA</span>
        </h1></li>
</ol>
<ol class="c4 lst-kix_list_36-1 start" start="1">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">If you wish to make (a) an access request for access to your Personal Data which we hold or information about the ways in which we use or disclose your Personal Data, or (b) a correction request to correct or update any of your Personal Data which we hold, you may submit your request in writing or via email to our Data Protection Officer at the contact details provided below.</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="2">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">Please note that a reasonable fee may be charged for an access request. If so, we will inform you of the fee before processing your request.</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="3">
    <li class="c6 li-bullet-0"><h2 style="display:inline"><span class="c2">We will respond to your request as soon as reasonably possible. Should we not be able to respond to your request within thirty (30) days after receiving your request, we will inform you in writing within thirty (30) days of the time by which we will be able to respond to your request. If we are unable to provide you with any Personal Data or to make a correction requested by you, we shall generally inform you of the reasons why we are unable to do so (except where we are not required to do so under the Act).</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-0" start="5">
    <li class="c14 li-bullet-0"><h1 style="display:inline"><span class="c18">PROTECTION OF PERSONAL DATA</span></h1>
    </li>
</ol>
<ol class="c4 lst-kix_list_36-1 start" start="1">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">We aim to treat your Personal Data with the care and diligence. To safeguard your Personal Data from unauthorised access, collection, use, disclosure, copying, modification, disposal or similar risks, we, to the extent required by the Act, have introduced appropriate administrative, physical and technical measures such as up-to-date antivirus protection, encryption and the use of privacy filters to secure all storage and transmission of Personal Data by us, and disclosing Personal Data both internally and to our franchisees, authorised third party service providers and agents only on a need-to-know basis.</span>
        </h2></li>
</ol>
<p class="c9"><span class="c2"></span></p>
<ol class="c4 lst-kix_list_36-1" start="2">
    <li class="c6 li-bullet-0"><h2 style="display:inline"><span class="c2">You should be aware, however, that no method of transmission over the Internet or method of electronic storage is completely secure. While security cannot be guaranteed, we strive to protect the security of your information and are constantly reviewing and enhancing our information security measures.</span>
