    </li>
</ol>
<ol class="c4 lst-kix_list_36-1 start" start="1">
    <li class="c1 li-bullet-0"><h2 style="display:inline"><span class="c2">We may retain your Personal Data for as long as it is necessary to fulfil the purpose for which it was collected, or as required or permitted by applicable laws.</span>
